package com.zhuqi.study.netty.LeeCodeSimple;

/**
 * 392. 判断子序列
 * 给定字符串 s 和 t ，判断 s 是否为 t 的子序列。
 *
 * 字符串的一个子序列是原始字符串删除一些（也可以不删除）字符而不改变剩余字符相对位置形成的新字符串。（例如，"ace"是"abcde"的一个子序列，而"aec"不是）。
 *
 * 进阶：
 *
 * 如果有大量输入的 S，称作 S1, S2, ... , Sk 其中 k >= 10亿，你需要依次检查它们是否为 T 的子序列。在这种情况下，你会怎样改变代码？
 *
 * 致谢：
 *
 * 特别感谢 @pbrother 添加此问题并且创建所有测试用例。
 *
 *
 *
 * 示例 1：
 *
 * 输入：s = "abc", t = "ahbgdc"
 * 输出：true
 * 示例 2：
 *
 * 输入：s = "axc", t = "ahbgdc"
 * 输出：false
 *
 *
 * 提示：
 *
 * 0 <= s.length <= 100
 * 0 <= t.length <= 10^4
 * 两个字符串都只由小写字符组成。
 * 通过次数106,409提交次数209,383
 * @author zhuqi at 2021/2/20
 */
public class LeCode0392 {
    public static void main(String[] args){

        LeCode0392 leCode0392 = new LeCode0392();
        boolean res1 = leCode0392.isSubsequence("abc", "ahbgdc");
        System.out.println("res1 = " + res1);
        boolean res2 = leCode0392.isSubsequence("axc", "ahbgdc");
        System.out.println("res2 = " + res2);
        boolean res3 = leCode0392.isSubsequence("acb", "ahbgdc");
        System.out.println("res3 = " + res3);
        boolean res4 = leCode0392.isSubsequence("aaaaaa", "bbaaaa");
        System.out.println("res4 = " + res4);

        boolean res5 = leCode0392.isSubsequence("leeeeetcode", "");
        System.out.println("res5 = " + res5);

    }

    public boolean isSubsequence(String s, String t) {
        int tLength = t.length();
        int sLength = s.length();
        int start = 0;
        for (int i = 0; i < sLength; i++) {
            char cs = s.charAt(i);
            boolean isContains = false;
            for (int j = start; j < tLength; j++) {
                if (cs==t.charAt(j)){
                    start=j+1;
                    isContains = true;
                    break;
                }
            }
            if (!isContains){return false;}
        }
        return true;
    }

}
